import React, {Component} from 'react';
import './Footer.css';

class Footer extends Component {
    render() {
        return(
                <footer>
                    <div className="container">
                        <div className="row  flex">
                            <a className="">
                                <img id="linkedin-icon" className="social-icon"/>
                            </a>

                            <a className="">
                                <img id="github-icon" className="social-icon"/>
                            </a>

                            <a className="">
                                <img id="whatsapp-icon" className="social-icon"/>
                            </a>
                        </div>
                    </div>
                </footer>
        )
    }
}

export default Footer;
